class Auth {
    constructor() {
        this.authenticated = false;
    }

    login() {
        this.authenticated = true;
    }

    logout() {
        this.authenticated = false;
    }

    isAuthenticated() {
        console.log('AUTHENTICATION' , this.authenticated);
        return this.authenticated;
    }
}

export default Auth();
